import React, {Component} from 'react'
import { NavLink } from 'react-router-dom'

class allDonor extends Component{
    constructor(props){
        super(props)
        this.state={
            donors: []

        }
    }
    // componentDidMount(){
    //     DonorService.getDonors().then((res) => {
    //         this.setState({ donors: res.data});
    //     });
    // }
    render(){
        return(
            <div>
                <br></br>
                <ul className="header"> 
          
          <li><NavLink exact to="/Donor">Donor</NavLink></li>
          <li><NavLink to ="/search">Search Donor</NavLink></li>
          <li><NavLink to ="/Stock">Stock</NavLink></li>
          <li><NavLink to ="/DeleteDonor">Delete Donor</NavLink></li>
          <li><NavLink to ="/exit">Exit</NavLink></li>

         </ul>
                <h2 className="text-center"> Donor List</h2>
                <div className="row">
                    <table className="table table-striped table-borderd">
                        <thead>
                            <tr>
                                
                                <th> First Name</th>
                                <th> Last Name</th>
                                <th> Email Id</th>
                                <th> Mobile No</th>
                                <th> Gender</th>
                                <th> Blood Group</th>
                                <th> City</th>
                                <th>Complete Address</th>
                                <th>D.O.B</th>

                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.donors.map(
                                    donor=>
                                    <tr key= {donor.id}>
                                        
                                        <td> {donor.firstName}</td>
                                        <td> {donor.lastName}</td>
                                        <td> {donor.emailId}</td>
                                        <td> {donor.fatherName}</td>
                                        <td> {donor.motherName}</td>
                                        <td> {donor.mobNo}</td>
                                        <td> {donor.gender}</td>
                                        <td> {donor.bloodGroup}</td>
                                        <td> {donor.city}</td>
                                        <td> {donor.completeAddress}</td>
                                        

                                        

                                    </tr>
                                 )
                                }
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}
export default allDonor
